import React from "react";
import styles from "../styles/ProjectBox.module.css";

export default function ProjectBox() {
  return (
    <div
      style={{
        color: "white",
        width: "20vw",
        height: "16vw",
        backgroundColor: "rgba(255, 255, 255, 0.2)",
        borderRadius: "20px",
        border: "1px solid rgba(255,255,255,0.4)",
        boxShadow: "0px 12px 20px rgba(112, 144, 176, 0.2);",
        padding: "50px",
      }}
    >
      <div
        style={{
          display: "flex",
          gap: "24px",
        }}
      >
        <div
          style={{
            padding: "4px 10px",
            backgroundColor: "rgba(112, 144, 176, 1)",
            fontSize: "12px",
            borderRadius: "10px",
          }}
        >
          GAME
        </div>
        <div
          style={{
            padding: "4px 10px",
            backgroundColor: "rgba(112, 144, 176, 1)",
            fontSize: "12px",
            borderRadius: "10px",
          }}
        >
          UX/UI
        </div>
      </div>
      <h1
        style={{
          fontSize: "2rem",
          marginTop: "10px",
        }}
      >
        Ping Pong Track
      </h1>
      <div className={styles.iconBox}>
        <img src="1.png" alt="아이콘" />
        <img src="2.png" alt="아이콘" />
        <img src="3.png" alt="아이콘" />
        <img src="4.png" alt="아이콘" />
        <img src="5.png" alt="아이콘" />
      </div>
      <div className={styles.info}>
        <div style={{ display: "flex" }}>
          <div
            style={{
              display: "flex",
              alignItems: "center",
              marginRight: "20px",
            }}
          >
            <img src="6.png" alt="아이콘" />
            <span>100</span>
          </div>
          <div style={{ display: "flex", alignItems: "center" }}>
            <img src="6.png" alt="아이콘" />
            <span>100</span>
          </div>
        </div>
        <div style={{ display: "flex", alignItems: "center" }}>
          <img src="6.png" alt="" />
          <span>not recruiting ( 0/20 )</span>
        </div>
      </div>
    </div>
  );
}
